import React, {Component} from "react";
import './add_product';

export default  class RecordList extends Component {
    constructor(props) {
        super(props);
        this.index = this.in
    }
    
    index() {
        if (document.querySelector('#accept:checked')){
            alert("checked") ;
          } else {
            alert("You didn't check it! Let me check it for you.")
          }
        }
    

       
    render() {

        return(
            
            <div>

            <input type="checkbox" onChange={this.index}  />
            
            <td className = 'a'>{this.props.obj.d_sku}</td>

            <td className = 'a'>{this.props.obj.d_name}</td>
  
            <td className = 'a'>{this.props.obj.d_price + "$"}</td>
  
            <td className = 'a'>{this.props.obj.d_attribute}</td>

            </div>
        )
    }
}
